    constructor(){
        this.database = new bettersqlite3("database.db");
        this.database.exec("CREATE TABLE IF NOT EXISTS Score  (id INTEGER PRIMARY KEY AUTOINCREMENT, score INTEGER)");

        this.userTable = new UserTable(this.database);
